import './App.css';
import LogIn from './Component/pageJoin/LogIn';
import PageChat from './Component/pageChat/PageChat.js';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import {routes } from "./route"
function App() {

  const displayPages = (listPage) => {
    return listPage.map((page,index) => {
      return <Route 
      key={ page.name}
      component = { page.component()}
      exact = {page.exact}
      path={page.path}
      />
    }) 
  }

  return (
    <Router>
      <Switch>
      {displayPages(routes)}
      </Switch>
    </Router>
  );
}

export default App;
